import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";

const RolezandoList = () => {
  const [list, setList] = useState();
  const [hasError, setHasError] = useState(false);

  useEffect(() => {
    const data = fetch(URL_GOOGLE_SHEETS).then((res) => res.text());

    data.then((result) => console.log(result));
  }, []);

  const convertData = () => {
    let csv = `"Carimbo de data/hora",
      "Endereço de e-mail",
      "Nome do lugar?",
      "Cidade:",
      "Categoria: ",
      "Preço:",
      "Tem espaço para crianças?",
      "Nota para o lugar:",
      "Comentários:";
    "08/10/2023 19:18:42",
      "keyla.klc@gmail.com",
      "Teste",
      "Sorocaba",
      "Pizzaria, Hamburgueria, Churrascaria, Japonesa",
      "4",
      "Não",
      "2",
      "Sem notas"`;

    var lines = csv.split("\n");

    var result = [];

    var headers = lines[0].split(",");

    for (var i = 1; i < lines.length; i++) {
      var obj = {};
      var currentline = lines[i].split(",");

      for (var j = 0; j < headers.length; j++) {
        obj[headers[j]] = currentline[j];
      }

      result.push(obj);
    }

    console.log(result);

    return JSON.stringify(result); //JSON
  };

  convertData();

  return (
    <>
      {/* {list.map((item) => (
        <RoleItem data={item} />
      ))} */}
    </>
  );
};

export default RolezandoList;
